    const clickOnNext=()=>{
        let myCurrentCount=currentbackImg;
        if(currentbackImg>4){             
            setCurrentBackImg(0)
            myCurrentCount=0
        }
        console.log('myCurrentCount: ', myCurrentCount)
            //if the currrent image count is 4 rest to 0 else cary on
    //    if(currentbackImg>=4){          
            
    //         setCurrentBackImg(0)
    //     }else{
            for(let i=0; i<4; i++){
                    if(i==myCurrentCount){
                        
                        if(myCurrentCount!=3)    mydots.current.children[myCurrentCount+1].className='dot active-dot'
                        if(myCurrentCount==3) mydots.current.children[0].className='dot active-dot'
                        //console.log(currentbackImg, ' ', i)
                    }
                    else{
                        // if(myCurrentCount==0) if(myCurrentCount!=3)    mydots.current.children[myCurrentCount].className='dot active-dot'
                         mydots.current.children[myCurrentCount].className='dot'
                    }
            }
            setCurrentBackImg(currentbackImg+1)
      // }
       
    }
    const clickOnPrev=()=>{

    }

    const overCarrousel=()=>{
        prevB.current.style.opacity=1;
        nextB.current.style.opacity=1;   
        mydots.current.style.opacity=1;   
    }
    const mouseOutOfCarrousel=()=>{
        prevB.current.style.opacity=0;
        nextB.current.style.opacity=0;  
        mydots.current.style.opacity=0;       
    }
    
    // const changeingbackground=()=>{

    // }
    // setInterval(()=>{
    //    if(currentbackImg<4){
    //     // carrousel.current.style.backgroundImage=`url('${backReserve[currentbackImg]}')`
    //     // setCurrentBackImg(currentbackImg+1)
    //     // console.log(backReserve[currentbackImg])
    //    }
    //    else{
    //     // setCurrentBackImg(0)
    //    }
    // },7000)
    return (
        <div className="homeWrapper">
            <section className="myVideo">
                <video className="thevideo" src="https://imgoss.wkzuche.com/web_imgs/pc/wkzuche/video/index.mp4" initial-time="0" autoplay="true" loop="true" muted="true" direction="0" data-v-190cf520=""></video>
            </section>
           {/* <section className="carrousel" onMouseOver={overCarrousel} onMouseOut={mouseOutOfCarrousel} ref={carrousel} >

                <div className="buttons">
                    <button className="prev" ref={prevB} onClick={clickOnPrev}><LeftOutlined /></button>
                    <button className="next" ref={nextB} onClick={clickOnNext}> <RightOutlined /></button>
                </div>
                
                <div className="carWrap">
                </div>
               
                <div className="dots" ref={mydots}>
                    <span className="dot active-dot"></span>
                    <span className="dot"></span>
                    <span className="dot"></span>
                    <span className="dot"></span>
                </div>
           </section> */}
